export const years = [];

export const getApi = (query) => {
  return fetch("https://api.partly.com/node-api/graphql", {
    method: "POST",
    headers: { "Content-Type": "application/json" },
    body: JSON.stringify({
      query: query,
    }),
  }).then((response) => response.json());
};
